#include <stdio.h>
#include <stdlib.h>
#include <time.h>

clock_t start, stop;

typedef struct String{
    char* data;
    int len;
}String;

String* initString(){
    String* S = (String*)malloc(sizeof(String));
    S->len = 0;
    S->data = NULL;
    return S;
}

void stringAssign(String* S, char* data){
    if(S->data){
        free(S->data);
    }
    char* temp = data;
    int len = 0;
    while(*temp){
        len++;
        temp++;
    }
    if(len == 0){
        S->len = 0;
        S->data = NULL;
    }
    else{
        S->data = (char* )malloc(sizeof(char) * (len + 1));
        temp = data;
        S->len = len;
        for(int i = 0; i <= len; i++){
            S->data[i] = temp[i];
        }  
    }
}

void printString(String* S){
    for(int i = 0; i < S->len; i++){
        printf(i == 0 ? "%c " : "->%c ", S->data[i]);
    }   
    putchar('\n');
}

void forceMatch(String* master, String* sub){
    int i =0;
    int j = 0;
    while(i < master->len && j < sub->len ){
        if(master->data[i] == sub->data[j]){
            i++;
            j++;
        }
        else{
            i = i - j + 1;
            j = 0;
        }
    }
    if(j == sub->len){
        printf("force match success.\n");
    }
    else{
        printf("force match fail.\n");
    }
}

int main(int ac, char* av[]){
    start = clock();
    String* S= initString();
    String* S1 = initString();
    char* c1 = "";
    stringAssign(S, c1);
    stringAssign(S1, "abcd");
    // printString(S);
    // printString(S1);
    forceMatch(S, S1);
    stop = clock();
    double duration = ((double)(stop-start)/CLK_TCK);
    printf("times: %f\n",duration);
    system("pause");
    return 0;
}